import React, { Component } from "react";
import "./weather.scss";
import Forecast, { getForecast } from "./Forecast.jsx";

export default class Weather extends Component {
  render() {
    return (
      <div className="main">
        <input type="input" class="form__field" placeholder="City-Name" />

        <button type="submit" className="button" onClick={Forecast.getForecast}>
          Get Weather
        </button>

        <Forecast />
      </div>
    );
  }
}
